import { ReactComponent as Triangle } from "./Polygon1.svg";
import { ReactComponent as Triangle2 } from "./Polygon2.svg";

import "./Triangles.css";

const Triangles = () => {
  return (
    <div>
      <div className="Triangle2">
        <Triangle2 />
      </div>
      <a className="Triangle">
        <Triangle />
      </a>
      
    </div>
  );
};

export default Triangles;
